-- ----------------------------
-- Table structure for fa_agent_rebate_config
-- ----------------------------
DROP TABLE IF EXISTS `fa_agent_rebate_config`;
CREATE TABLE `fa_agent_rebate_config`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `agent_id` int(11) NOT NULL COMMENT '代理商ID',
  `sports_no_win_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '竞彩不中奖返水比例(%)',
  `sports_bet_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '竞彩投注返水比例(%)',
  `welfare_no_win_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '福彩不中奖返水比例(%)',
  `welfare_bet_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '福彩投注返水比例(%)',
  `sports_single_no_win_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '单场不中奖返水比例(%)',
  `sports_single_bet_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '单场投注返水比例(%)',
  `quick_no_win_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '快彩不中奖返水比例(%)',
  `quick_bet_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '快彩投注返水比例(%)',
  `rebate_type` enum('profit','bet') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'profit' COMMENT '返水方式:profit=盈利返水,bet=投注返水',
  `settlement_cycle` enum('1','7','30','90') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '7' COMMENT '结算周期(天):1=1天,7=7天,30=30天,90=90天',
  `settlement_time` time NOT NULL DEFAULT '23:45:00' COMMENT '结算时间',
  `is_enabled` tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否启用:0=禁用,1=启用',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `agent_id`(`agent_id` ASC) USING BTREE,
  INDEX `idx_agent_enabled`(`agent_id` ASC, `is_enabled` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 12 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '代理商返水配置表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of fa_agent_rebate_config
-- ----------------------------

-- ----------------------------
-- Table structure for fa_agent_rebate_record
-- ----------------------------
DROP TABLE IF EXISTS `fa_agent_rebate_record`;
CREATE TABLE `fa_agent_rebate_record`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `agent_id` int(11) NOT NULL COMMENT '代理商ID',
  `category` enum('SPORTS','WELFARE','SPORTS_SINGLE','QUICK') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '彩种分类',
  `bet_amount` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '投注金额',
  `win_amount` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '中奖金额',
  `no_win_amount` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '未中奖金额',
  `profit_loss` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '盈亏金额(负数为亏损)',
  `rebate_amount` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '返水金额',
  `commission_amount` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '佣金金额',
  `rebate_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '返水比例(%)',
  `no_win_rebate_amount` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '未中奖返佣金额',
  `no_win_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '未中奖返佣比例(%)',
  `bet_rebate_amount` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '投注返佣金额',
  `bet_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '投注返佣比例(%)',
  `rebate_type` enum('profit','bet') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '返水方式',
  `settlement_date` date NOT NULL COMMENT '结算日期',
  `record_status` enum('pending','settled') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'pending' COMMENT '记录状态:pending=待结算,settled=已结算',
  `settlement_time` int(11) NULL DEFAULT NULL COMMENT '结算时间戳',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_agent_date`(`agent_id` ASC, `settlement_date` ASC) USING BTREE,
  INDEX `idx_agent_status`(`agent_id` ASC, `record_status` ASC) USING BTREE,
  INDEX `idx_settlement_date`(`settlement_date` ASC) USING BTREE,
  INDEX `idx_category`(`category` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 26 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '代理商返水记录表' ROW_FORMAT = Dynamic;

