-- ----------------------------
-- Table structure for fa_agent_rebate_settlement
-- ----------------------------
DROP TABLE IF EXISTS `fa_agent_rebate_settlement`;
CREATE TABLE `fa_agent_rebate_settlement`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `agent_id` int(11) NOT NULL COMMENT '代理商ID',
  `settlement_date` date NOT NULL COMMENT '结算日期',
  `settlement_cycle` enum('1','7','30','90') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '结算周期(天)',
  `total_bet_amount` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '总投注金额',
  `total_win_amount` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '总中奖金额',
  `total_profit_loss` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '总盈亏金额',
  `total_rebate_amount` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '总返水金额',
  `commission_amount` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '佣金金额',
  `sports_rebate` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '竞彩返水',
  `welfare_rebate` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '福彩返水',
  `sports_single_rebate` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '单场返水',
  `quick_rebate` decimal(15, 2) NOT NULL DEFAULT 0.00 COMMENT '快彩返水',
  `settlement_status` enum('pending','processing','completed','failed') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'pending' COMMENT '结算状态',
  `settlement_time` int(11) NULL DEFAULT NULL COMMENT '结算时间戳',
  `operator_id` int(11) NULL DEFAULT NULL COMMENT '操作员ID',
  `remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '备注',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `agent_date_cycle`(`agent_id` ASC, `settlement_date` ASC, `settlement_cycle` ASC) USING BTREE,
  INDEX `idx_agent_status`(`agent_id` ASC, `settlement_status` ASC) USING BTREE,
  INDEX `idx_settlement_date`(`settlement_date` ASC) USING BTREE,
  INDEX `idx_settlement_status`(`settlement_status` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 23 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '代理商返水发放记录表' ROW_FORMAT = Dynamic;

