-- ----------------------------
-- Table structure for fa_lottery_draw
-- ----------------------------
DROP TABLE IF EXISTS `fa_lottery_draw`;
CREATE TABLE `fa_lottery_draw`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `lottery_type_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '彩种ID',
  `lottery_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '彩种代码',
  `period_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '期号',
  `draw_numbers` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '开奖号码',
  `draw_result` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '开奖详情(JSON格式)',
  `total_sales` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '总销售额(分)',
  `prize_pool` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '奖池金额(分)',
  `draw_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '开奖时间',
  `settle_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '结算时间',
  `total_bet_amount` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '总投注金额(分)',
  `total_win_amount` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '总中奖金额(分)',
  `bet_count` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '投注笔数',
  `win_count` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '中奖笔数',
  `status` enum('PENDING','DRAWN','SETTLED') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'PENDING' COMMENT '状态:PENDING=待开奖,DRAWN=已开奖,SETTLED=已结算',
  `is_official` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否官方开奖:0=否,1=是',
  `remark` varchar(55) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '备注',
  `created_by` varchar(25) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT 'created_by',
  `create_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `lottery_period`(`lottery_code` ASC, `period_no` ASC) USING BTREE,
  INDEX `lottery_type_id`(`lottery_type_id` ASC) USING BTREE,
  INDEX `draw_time`(`draw_time` ASC) USING BTREE,
  INDEX `status`(`status` ASC) USING BTREE,
  INDEX `lottery_code`(`lottery_code` ASC) USING BTREE,
  INDEX `idx_lottery_type_period`(`lottery_type_id` ASC, `period_no` ASC) USING BTREE,
  INDEX `idx_draw_time_status`(`draw_time` ASC, `status` ASC) USING BTREE,
  INDEX `idx_status_draw_time`(`status` ASC, `draw_time` ASC) USING BTREE,
  INDEX `idx_create_time`(`create_time` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 27201 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '开奖结果表' ROW_FORMAT = DYNAMIC;

