-- ----------------------------
-- Table structure for fa_lottery_time
-- ----------------------------
DROP TABLE IF EXISTS `fa_lottery_time`;
CREATE TABLE `fa_lottery_time`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增主键ID，唯一标识每条记录',
  `lottery_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '彩种名称，最大长度 255，使用 utf8mb4 字符集',
  `draw_date` date NULL DEFAULT NULL COMMENT '日期',
  `draw_time_start` time NOT NULL COMMENT '开奖开始时间，格式为 TIME',
  `draw_time_end` time NOT NULL COMMENT '开奖结束时间，格式为 TIME',
  `closing_time` time NOT NULL COMMENT '截止时间，格式为 TIME',
  `next_issue_start_time` time NOT NULL COMMENT '下期开始时间，格式为 TIME',
  `current_issue_number` int(11) NOT NULL COMMENT '当前期号，表示当前彩种的期号',
  `issue_time_interval` int(11) NOT NULL COMMENT '期号生成时间间隔，单位为秒',
  `status` enum('active','inactive') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '彩种启用状态，取值为 active 或 inactive',
  PRIMARY KEY (`id`) USING BTREE COMMENT '主键索引，唯一标识每条记录',
  INDEX `idx_lottery_name`(`lottery_name`(191)) USING BTREE COMMENT '为 `lottery_name` 创建前缀索引，限制前 191 个字符防止索引超长',
  INDEX `idx_current_issue_number`(`current_issue_number`) USING BTREE COMMENT '为 `current_issue_number` 字段创建索引，加速根据期号查询',
  INDEX `idx_status`(`status`) USING BTREE COMMENT '为 `status` 字段创建索引，加速根据状态查询',
  INDEX `idx_draw_time_start`(`draw_time_start`) USING BTREE COMMENT '为 `draw_time_start` 字段创建索引，加速按开奖时间查询',
  INDEX `idx_next_issue_start_time`(`next_issue_start_time`) USING BTREE COMMENT '为 `next_issue_start_time` 字段创建索引，加速按下期开始时间查询',
  INDEX `idx_lottery_name_status`(`lottery_name`(191), `status`) USING BTREE COMMENT '创建 `lottery_name` 和 `status` 的联合索引，加速根据彩种和状态查询'
) ENGINE = MyISAM AUTO_INCREMENT = 3854 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of fa_lottery_time
-- ----------------------------

-- ----------------------------
-- Table structure for fa_lottery_type
-- ----------------------------
DROP TABLE IF EXISTS `fa_lottery_type`;
CREATE TABLE `fa_lottery_type`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `type_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '彩种代码',
  `type_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '彩种名称',
  `type_desc` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '彩种副标题',
  `type_group` enum('chess','ware','person','live') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'ware' COMMENT '彩票类型',
  `default_pool` decimal(10, 2) NOT NULL DEFAULT 10000.00 COMMENT '默认奖池（快彩才有）',
  `bonus_pool` decimal(10, 2) NOT NULL DEFAULT 10000.00 COMMENT '奖金池',
  `bonus_system` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '平台抽取',
  `bonus_system_rate` decimal(10, 1) NOT NULL DEFAULT 20.0 COMMENT '平台服务费百分比',
  `max_pool_rate` decimal(10, 1) NOT NULL DEFAULT 0.0 COMMENT '单人占用奖池百分比',
  `type_icon` varchar(155) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '彩种图标',
  `category` enum('SPORTS','WELFARE','SPORTS_SINGLE','QUICK') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'WELFARE' COMMENT '彩种分类:SPORTS=竞彩,WELFARE=福彩,SPORTS_SINGLE=单场',
  `min_bet_amount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 200.00 COMMENT '最小投注金额(元)',
  `max_bet_amount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 1000000.00 COMMENT '最大投注金额(元)',
  `daily_limit` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '每日限额(元)',
  `commission_rate` decimal(5, 4) NOT NULL DEFAULT 0.0000 COMMENT '佣金比例',
  `close_time` time NULL DEFAULT NULL COMMENT '截止时间',
  `next_time` time NULL DEFAULT NULL COMMENT '下期开始时间',
  `auto_draw` tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否自动开奖:0=否,1=是',
  `last_draw_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '最后开奖时间',
  `odds_config` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '赔率配置(JSON格式)',
  `is_enabled` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否启用:0=禁用,1=启用',
  `sort_order` int(11) NOT NULL DEFAULT 0 COMMENT '排序权重',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '备注',
  `create_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '更新时间',
  `current_issue` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '当前期号',
  `last_issue_time` bigint(20) NULL DEFAULT NULL COMMENT '最后一次采集时间戳',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `type_code`(`type_code` ASC) USING BTREE,
  INDEX `category`(`category` ASC) USING BTREE,
  INDEX `is_enabled`(`is_enabled` ASC) USING BTREE,
  INDEX `idx_is_enabled_sort`(`is_enabled` ASC, `sort_order` ASC) USING BTREE,
  INDEX `idx_category_enabled`(`category` ASC, `is_enabled` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 33 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '彩种管理表' ROW_FORMAT = DYNAMIC;

