DROP TABLE IF EXISTS `fa_payment_method`;
CREATE TABLE `fa_payment_method`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '支付方式ID',
  `method_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '支付方式代码',
  `method_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '支付方式名称',
  `method_icon` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '支付方式图标',
  `description` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '支付方式描述',
  `is_enabled` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否启用:0=禁用,1=启用',
  `sort_order` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '排序',
  `created_by` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建人',
  `updated_by` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '更新人',
  `create_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `method_code`(`method_code` ASC) USING BTREE,
  INDEX `is_enabled`(`is_enabled` ASC) USING BTREE,
  INDEX `sort_order`(`sort_order` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 9 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '支付方式表' ROW_FORMAT = DYNAMIC;

