-- ----------------------------
-- Table structure for fa_rebate_config
-- ----------------------------
DROP TABLE IF EXISTS `fa_rebate_config`;
CREATE TABLE `fa_rebate_config`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '返佣规则名称',
  `config_type` enum('PLATFORM','AGENT') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'PLATFORM' COMMENT '配置类型:PLATFORM=平台返佣,AGENT=代理商返佣',
  `agent_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '代理商ID(代理商返佣时必填)',
  `target_users` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '目标用户ID列表(JSON数组,空=全部用户)',
  `target_lottery_types` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '目标彩种ID列表(JSON数组,空=全部彩种)',
  `min_bet_amount` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '最小投注金额(分)',
  `rebate_type` enum('PERCENTAGE','FIXED') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'PERCENTAGE' COMMENT '返佣类型:PERCENTAGE=百分比,FIXED=固定金额',
  `rebate_value` decimal(10, 4) NOT NULL DEFAULT 0.0000 COMMENT '返佣值(百分比或固定金额分)',
  `trigger_type` enum('betting','no_win') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'betting' COMMENT '触发时机:betting=投注时,no_win=未中奖时',
  `priority` int(11) NOT NULL DEFAULT 0 COMMENT '优先级(数值越大优先级越高)',
  `is_enabled` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否启用:0=禁用,1=启用',
  `start_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '生效开始时间',
  `end_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '生效结束时间',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '备注',
  `create_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `config_type`(`config_type` ASC) USING BTREE,
  INDEX `agent_id`(`agent_id` ASC) USING BTREE,
  INDEX `trigger_type`(`trigger_type` ASC) USING BTREE,
  INDEX `priority`(`priority` ASC) USING BTREE,
  INDEX `is_enabled`(`is_enabled` ASC) USING BTREE,
  INDEX `config_enabled_priority`(`config_type` ASC, `is_enabled` ASC, `priority` ASC) USING BTREE,
  CONSTRAINT `fk_rebate_config_agent` FOREIGN KEY (`agent_id`) REFERENCES `fa_user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '返佣配置表(整合平台和代理商返佣)' ROW_FORMAT = DYNAMIC;

