-- ----------------------------
-- Table structure for fa_recharge_order
-- ----------------------------
DROP TABLE IF EXISTS `fa_recharge_order`;
CREATE TABLE `fa_recharge_order`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '充值订单ID',
  `order_no` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '商户订单号',
  `trade_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '第三方交易编号',
  `user_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户ID',
  `amount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '充值金额（元）',
  `actual_amount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '实际到账金额（元）',
  `fee_amount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '手续费（元）',
  `gift_amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '赠送金额（元）',
  `status` enum('PENDING','PROCESSING','SUCCESS','FAILED','CANCELLED','TIMEOUT') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'PENDING' COMMENT '订单状态',
  `payment_method` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '支付方式',
  `payment_channel` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '支付通道',
  `payment_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '支付编码',
  `method_id` int(11) NOT NULL DEFAULT 0 COMMENT '支付方式ID',
  `channel_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '支付通道ID',
  `payment_url` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '支付链接',
  `qr_code` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '二维码内容',
  `client_ip` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '客户端IP',
  `user_agent` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '用户代理',
  `notify_count` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '通知次数',
  `last_notify_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '最后通知时间',
  `notify_content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '回调内容',
  `success_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '支付成功时间',
  `expire_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '过期时间',
  `remark` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '备注',
  `admin_remark` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '管理员备注',
  `create_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `order_no`(`order_no` ASC) USING BTREE,
  INDEX `trade_no`(`trade_no` ASC) USING BTREE,
  INDEX `user_id`(`user_id` ASC) USING BTREE,
  INDEX `status`(`status` ASC) USING BTREE,
  INDEX `channel_id`(`channel_id` ASC) USING BTREE,
  INDEX `create_time`(`create_time` ASC) USING BTREE,
  INDEX `success_time`(`success_time` ASC) USING BTREE,
  INDEX `user_status_time`(`user_id` ASC, `status` ASC, `create_time` ASC) USING BTREE,
  INDEX `payment_method_status`(`payment_method` ASC, `status` ASC) USING BTREE,
  CONSTRAINT `fk_recharge_order_channel` FOREIGN KEY (`channel_id`) REFERENCES `fa_payment_channel` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `fk_recharge_order_user` FOREIGN KEY (`user_id`) REFERENCES `fa_user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 87 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '充值订单表' ROW_FORMAT = DYNAMIC;

