-- ----------------------------
-- Table structure for fa_user
-- ----------------------------
DROP TABLE IF EXISTS `fa_user`;
CREATE TABLE `fa_user`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `group_id` int(10) UNSIGNED NOT NULL DEFAULT 1 COMMENT '分组ID',
  `parent_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '上级代理商ID',
  `username` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '用户名',
  `is_agent` smallint(6) NULL DEFAULT 0 COMMENT '是否代理商',
  `game_ids` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '游戏配置',
  `user_tag` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '用户标签',
  `nickname` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '昵称',
  `real_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '真实姓名(建议加密存储)',
  `level_id` int(11) NOT NULL DEFAULT 1 COMMENT '用户等级',
  `total_bet_amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '累计投注额',
  `id_card` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '身份证号(建议加密存储)',
  `email` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '邮箱',
  `mobile` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '手机',
  `avatar` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '头像',
  `gender` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '性别:0=未知,1=男,2=女',
  `birthday` date NULL DEFAULT NULL COMMENT '生日',
  `money` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '余额',
  `unwith_money` bigint(20) NOT NULL COMMENT '不可提现余额(不可提现金额，只用作显示，计算，不作实际使用)',
  `frozen_money` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '冻结金额（相关赠送的要投注才可解冻）',
  `gift_money` bigint(20) NULL DEFAULT 0 COMMENT '赠送金额（只用作显示，计算，不作实际使用）',
  `score` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '积分',
  `last_login_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '上次登录时间',
  `last_login_ip` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '上次登录IP',
  `login_failure` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '登录失败次数',
  `join_ip` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '加入IP',
  `join_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '加入时间',
  `motto` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '签名',
  `password` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '密码',
  `pay_password` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '支付密码(建议加密存储)',
  `is_verified` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否实名认证:0=未实名,1=已认证，2=审核中',
  `invite_code` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '邀请码',
  `invited_by` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '邀请人邀请码',
  `default_rebate_rate` decimal(5, 1) NOT NULL DEFAULT 0.0 COMMENT '默认投注返佣比例(%)',
  `default_nowin_rate` decimal(5, 1) NOT NULL DEFAULT 0.0 COMMENT '默认不中奖返佣比例(%)',
  `rebate_rate` decimal(5, 1) NOT NULL DEFAULT -1.0 COMMENT '投注返佣比例(%)',
  `nowin_rate` decimal(5, 1) NOT NULL DEFAULT -1.0 COMMENT '不中奖返佣比例(%)',
  `agent_favorite` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '代理收藏状态:0=未收藏,1=已收藏',
  `last_bet_time` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '最后投注时间',
  `register_ip` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '注册IP',
  `extra_data` json NULL COMMENT '扩展数据字段',
  `salt` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '密码盐（废弃待删）',
  `status` smallint(6) NOT NULL DEFAULT 1 COMMENT '状态:1=启用,2=禁用,0=审核中',
  `update_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '更新时间',
  `create_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `username`(`username` ASC) USING BTREE,
  INDEX `parent_id`(`parent_id` ASC) USING BTREE,
  INDEX `invite_code`(`invite_code` ASC) USING BTREE,
  INDEX `invited_by`(`invited_by` ASC) USING BTREE,
  INDEX `is_verified`(`is_verified` ASC) USING BTREE,
  INDEX `group_status`(`group_id` ASC, `status` ASC) USING BTREE,
  INDEX `idx_parent_agent_favorite`(`parent_id` ASC, `agent_favorite` ASC) USING BTREE,
  INDEX `idx_agent_favorite`(`agent_favorite` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 69 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '会员表' ROW_FORMAT = DYNAMIC;

