  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '会员ID',
  `type` enum('ADMIN_ADD','ADMIN_DEDUCT','BET_DEDUCT','PRIZE_ADD','WITHDRAW_DEDUCT','WITHDRAW_REFUND_ADD','BET_REFUND_ADD','COMMISSION_ADD','ACTIVITY_REWARD_ADD','RED_PACKET_SEND','RED_PACKET_CANCEL','RED_PACKET_RECEIVE','AGENT_ADD_TO_USER','AGENT_DEDUCT_FROM_USER','RECHARGE_ADD','BONUS_ADD','PROMOTION_INCOME','RECHARGE_GIFT_ADD','RECHARGE_GIFT_DEDUCT') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'ADMIN_ADD',
  `money` int(11) NOT NULL DEFAULT 0 COMMENT '变更余额',
  `before` int(11) NOT NULL DEFAULT 0 COMMENT '变更前余额',
  `after` int(11) NOT NULL DEFAULT 0 COMMENT '变更后余额',
  `frozen_change` int(11) NOT NULL DEFAULT 0 COMMENT '冻结余额变动金额',
  `frozen_before` int(11) NOT NULL DEFAULT 0 COMMENT '变更前冻结余额',
  `frozen_after` int(11) NOT NULL DEFAULT 0 COMMENT '变更后冻结余额',
  `related_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '关联ID(订单ID、红包ID等)',
  `operator_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '操作员ID(代理商或管理员)',
  `operator_type` enum('admin','agent','system') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'system' COMMENT '操作员类型:admin=管理员,agent=代理商,system=系统',
  `memo` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '备注',
  `create_time` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `type`(`type` ASC) USING BTREE,
  INDEX `related_id`(`related_id` ASC) USING BTREE,
  INDEX `operator_id`(`operator_id` ASC) USING BTREE,
  INDEX `user_type_time`(`user_id` ASC, `type` ASC, `create_time` ASC) USING BTREE,
  INDEX `idx_user_type_time`(`user_id` ASC, `type` ASC, `create_time` ASC) USING BTREE,
  INDEX `idx_user_time`(`user_id` ASC, `create_time` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 619481 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '会员余额变动表' ROW_FORMAT = DYNAMIC;

