INSERT INTO `fa_dano` VALUES (1, '防骗通知', '1.长期有不法分子，传播非法信息进行诈骗活动！（例如:网址更改， 网站升级，资料转移，公司合并等）要求您提供会员账号和登入密码，取款密码信息，均为骗子！切记！\n\n2.BNB娱乐没有任何分公司/分站，也不会以任何理由要求会员提供任何密码！也不会通过短信或者打电话通知您新的网站！如您打开公司网址跳转到其他公司页面，请务必马上关闭，避免资金损失，此类均为欺诈网站！ 请广大会员互相转告，以免上当受骗！\n\n3.请各位会员保管好您的个人信息及支付信息切勿将信息泄露他人，以免被不法分子利用对您造成不必要的损失！另外，建议您定期更换复杂的登陆密码，以免被尝试登录爆破，以保障您账号信息安全。感谢您对BNB娱乐的大力支持，致敬！\n\n4.【BNB】郑重承诺：本集团永久独立运营！至尊信誉，安全保障！请广大会员务必认准官方导航域名以及logo，导航域名内会不定期更新最新的游戏网址，记住导航，永不迷路！若出现无法访问或网址跳转等情况请及时联系我们处理。\n\n有任何疑问请及时联系我们7x24小时在线客服为您解答！', '2025-07-30 17:21:14', 4, 1, '2025-08-14 15:48:33');
INSERT INTO `fa_dano` VALUES (2, '月月领彩金', '领取时间：（北京时间）每月1号～10号\n活动内容：（月月回馈）当月达到指定有效投注或对应存款量，次月即可获得最高3888元彩金。\n\n月有效投注	彩金\n3万元+	         18\n10万元+	         38\n50万元+	        188 \n100万元+	        588\n1000万元+      3888\n月总充值	        彩金\n3000元+    	18\n5000元+   	38\n10000元+	88', '2025-07-30 17:21:14', 2, 1, '2025-08-14 16:30:41');
INSERT INTO `fa_dano` VALUES (3, '天天领红包，不中返', '为了回馈广大会员宝宝，我们特别推出红包活动！活动期间，新老会员每日可获得随机红包奖励。此外，还有充值返利、邀请好友等多重福利等您来拿。活动时间：长期有效！                                                                                                                                                                                        运气不佳接连不中，平台随机送不中返点。', '2025-07-30 17:21:14', 1, 1, '2025-08-14 16:30:28');
INSERT INTO `fa_dano` VALUES (5, '分享赚钱', '推荐下线方式 \n1.可通过以下“添加会员”功能键，帮您的下线注册会员账号；\n2.可通过以下“快速推广链接”功能键，复制推广链接给您的下线注册会员账号。\n\n佣金结算方式 ：\n1-不计输赢总有效投注x元返点比例，如:（总有效投注￥1000万x0.4%=40000元佣金)\n有效投注            	彩票返点            	直播游戏返点            	电子返点            	棋牌返点            \n一元起                       0.1%            	           0.1%            	                   0.6%                       0.7%          \n不可用不计输赢结算游戏：无\n\n2-时间周期内输赢结算返点，如：（总有效投注￥1000万-【赢】900万=100万x30% =30万元）\n结算周期：          10天    30天      90天    \n返点比例：           7%    22.5%     46%      \n不可用周期内结算的游戏：彩票、直播游戏。\n\n结算时间：结算日23:45分。\n\n注：请谨记任何使用不诚实方法以骗取代理佣金者将取消代理资格并永久冻结账户，佣金一概不予派发！', '2025-08-14 15:46:57', 3, 1, '2025-08-14 16:33:07');
INSERT INTO `fa_lottery_bonus` VALUES (1, 2, '直选复式', 'zhixuan_fushi', 2.00, 10000.00, '[\"1800\"]', 1, '玩法说明：从百位、十位、个位中选择一个3位数号码组成一注，所选号码与开奖号码相同，且顺序一致，即为中奖。\r\n\r\n投注方案：3,4,5；开奖号码：345，顺序一致，即中奖。', 0, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (2, 2, '直选和值', 'zhixuan_hezhi', 10.00, 5000.00, '[\"9000\",\"3000\",\"1500\",\"900\",\"600\",\"428\",\"320\",\"250\",\"200\",\"163\",\"142\",\"130\",\"123\",\"120\",\"120\",\"123\",\"130\",\"142\",\"163\",\"200\",\"250\",\"320\",\"428\",\"600\",\"900\",\"1500\",\"3000\",\"9000\"]', 1, '玩法说明：选择1个号码，与开奖号码的百位、十位、个位三个数字相加之和相同，即中奖。\r\n\r\n投注方案：1；开奖号码：001、010、100,即中奖。', 0, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (3, 2, '直选跨度', 'zhixuan_kuadu', 10.00, 1000.00, '[\"900\",\"160\",\"93\",\"70\",\"62\",\"60\",\"62\",\"70\",\"93\",\"166\"]', 1, '选择开奖号码的跨度，跨度为开奖号码中最大数字与最小数字的差值，跨度范围0-9。例如开奖号码357，跨度为7-3=4。', 0, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (4, 2, '组三单式', 'zusan_danshi', 2.00, 1000.00, '[\"600\"]', 1, '玩法说明：选择2位数号码组成一注，所选号码与开奖号码相同，且顺序不限，即为中奖。\r\n\r\n投注方案：221，开奖号码是122，212，221，即为中奖。', 0, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (5, 2, '组三复式', 'zusan_fushi', 10.00, 2000.00, '{\"2\":\"1500\",\"3\":\"500\",\"4\":\"250\",\"5\":\"150\",\"6\":\"100\",\"7\":\"72\",\"8\":\"54\",\"9\":\"42\",\"10\":\"12\"}', 1, '玩法说明：从0-9中选择2个数字组成两注，所选号码与开奖号码相同，且顺序不限，即为中奖。\r\n\r\n投注方案：12（展开为122,212,221和112,121,211），开奖号码为212或121，即为中奖。', 6, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (6, 2, '组六复式', 'zuliu_fushi', 10.00, 3000.00, '{\"3\":\"600\",\"4\":\"300\",\"5\":\"150\",\"6\":\"75\",\"7\":\"43\",\"8\":\"27\",\"9\":\"18\",\"10\":\"12\"}', 1, '玩法说明：从0-9中任意选择3个号码组成一注，所选号码与开奖号码相同，顺序不限，即为中奖。\r\n\r\n投注方案：123；开奖号码：三位包含123，顺序不限，即中奖。', 4, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (7, 2, '一码定位', 'zuxuan_yima_dingwei', 2.00, 1000.00, '[\"10\"]', 1, '从百位、十位、个位中选择一个位置，再选择一个或多个号码，开奖号码对应位置包含所选号码即为中奖。例如选择百位5，开奖号码5XX即中奖。', 15, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (8, 2, '两码定位', 'zuxuan_liangma_dingwei', 2.00, 1500.00, '[\"100\"]', 1, '从百位、十位、个位中选择两个位置，再分别选择号码，开奖号码对应位置都包含所选号码即为中奖。例如选择百位5十位3，开奖号码53X即中奖。', 14, 1, NULL);
INSERT INTO `fa_lottery_bonus` VALUES (9, 2, '一码不定位', 'zuxuan_yima_budingwei', 2.00, 800.00, '[\"3.5\"]', 1, '选择一个或多个号码，开奖号码的百位、十位、个位中任意一位包含所选号码即为中奖。例如选择5，开奖号码5XX、X5X、XX5任意一个都中奖。', 13, 1, NULL);
